        $use->pilihan2=$pil2[$i];
        $use->pilihan3=$pil3[$i];
        $use->pilihan4=$pil4[$i];
        $use->benar=$bnr[$i];
        $use->soal=$prtny[$i];
        $use->foto=$pict[$i];
        $i++;
        
        }
    }
}
